interface IFormData {
    [key: string]: string;
}

function ToDoList() {
    const {
        register,
        handleSubmit,
        formState: { errors },
    } = useForm<IFormData>();
    const onValid = (data: any) => {};
    console.log(errors);

    return (
        <div>
            <form onSubmit={handleSubmit(onValid)} style={{ display: "flex", flexDirection: "column" }}>
                <input
                    {...register("email", {
                        required: "Email is required",
                        pattern: {
                            value: /^[A-Za-z0-9._%+-]+@naver.com$/,
                            message: "Only naver.com emails allowed",
                        },
                    })}
                    placeholder="Email"
                />
                <span style={{ color: "#fff", background: "black" }}>{errors?.email?.message}</span>
                <input {...register("firstName", { required: true })} type="text" placeholder="first name" />
                <input {...register("lastName", { required: true })} type="text" placeholder="last name" />
                <input {...register("userName", { required: true, minLength: 5 })} type="text" placeholder="userName" />
                <input
                    {...register("passWord", {
                        required: "password is required",
                        minLength: { value: 5, message: "password is too short" },
                    })}
                    type="text"
                    placeholder="passWord"
                />
                <button>Add</button>
            </form>
        </div>
    );
}

